import React from "react";

import { Grid, Typography, makeStyles } from '@material-ui/core';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';

import CustomPieChart from "components/Graphs/PieChart";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";

const useStyles = makeStyles(() => ({
    grid: {
        display: 'flex',
        flexFlow: 'row wrap'
    }
}))

export default function Kpi4(props) {
    const classes = useStyles();

    return (
        <Grid container spacing={2} xs={12} sm={12} md={12} lg={12} className={classes.grid} >
            <Grid item xs={12} sm={12} md={12} lg={6} >
                <Card>
                    <CardHeader>
                        <Typography variant="h5">Total Product Sales</Typography>

                        <CustomPieChart products={props.products} />
                    </CardHeader>
                </Card>
            </Grid>
            <Grid item xs={12} sm={12} md={12} lg={6} >
                <Card>
                    <CardHeader>
                        <Typography variant="h5">Total Dollar Sales</Typography>
                        <CustomPieChart totalSales={props.totalSales} />
                    </CardHeader>
                </Card>
            </Grid>
        </Grid>
    )
}
